import React from "react";

function UserDashboard() {
  return (
    <div className="dashboard">
   
      <aside className="sidebar">
        <ul>
          <li>Home</li>
          <li>Saved Recipes</li>
          <li>Friends</li>
        </ul>
      </aside>
    </div>
  );
}

export default UserDashboard;
